import axios from 'axios'
import React, { Component } from 'react'

class Users extends Component{

    constructor(){
        super();
        this.state = {
            data : [],
        }
    }

    componentDidMount(){

        axios.get('https://jsonplaceholder.typicode.com/users')
        .then( response =>{


        this.setState({
            data : response.data
        })
        })



    }

    render(){
        return(
                <div className='box'>
                    <h1>{this.state.data}</h1>
                </div>

        )
    }
}

export default Users
